import React, { useState } from 'react';
import {Button} from 'antd'
import { Table, Space } from 'antd';
import {Container} from './style';

export default function Painel({btns, children}){
    const [selectRowKeys, setSelectRowKeys] = useState([]);

    const columns = [
        {
          title: 'aluno',
          dataIndex: 'aluno',
          key: 'aluno',
          render: aluno => <a>{aluno}</a>,
        },
        {
          title: 'email',
          dataIndex: 'email',
          key: 'email',
        },
        {
          title: 'ra',
          dataIndex: 'ra',
          key: 'ra',
        },
        {
          title: 'action',
          key: 'action',
          render: (text, record) => (
            <Space size="middle">
              <a>Ler</a>
              <a>Parecer</a>
            </Space>
          ),
        },
      ];

    const data = []

    for(let i=1; i<40; i++){
      data.push({
        key: `${i}`,
        aluno: 'Carlos',
        email: 'carlitos@unesp.br',
        ra: '554112341'
      })
    }

    const onSelectChange = (selectedRowKeys) => {
      console.log('selectedRowKeys changed: ', selectedRowKeys);
      setSelectRowKeys = selectRowKeys;
    };

    const rowSelection = {
      selectedRowKeys,
      onChange: onSelectChange,
    };

    return(
        <Container>
            <Table columns={columns} dataSource={data} />
        </Container>
    );
}
